class consumoActions extends sfActions {

    /**
     * Executes index action
     *
     * @param sfRequest $request A request object
     */
    public function executeUsuario(sfWebRequest $request) {
        $filename = 'listado.xls';

        $inputFileName = sfConfig::get("sf_upload_dir") . DIRECTORY_SEPARATOR . $filename;
        $objReader = new PHPExcel_Reader_Excel5();
        $objPHPExcel = $objReader->load($inputFileName);
        $sheetData = $objPHPExcel->getActiveSheet()->toArray(null, true, true, true);
//        echo "<pre>";
//        print_r($sheetData);
//        die();

        $conta = 0;
        foreach ($sheetData as $lista) {
            $conta++;
            if ($conta > 1) {
                $url = 'http://iqrh:8080/iqrh_dev.php/rest/usuario';
            //    $data['actualizaFoto'] = $lista['']; //$request->getParameter('actualiaFoto');
                $data['usuario'] = trim($lista['H'].trim($lista['J'])); //$request->getParameter('usuario');
            
                $data['correo'] = $lista['B']; //$request->getParameter('correo');
                $c = rand(1, 5);
                $data['logo'] = $this->image($c); //$request->getParameter('logo');
                $data['genero'] = $lista['D']; //$request->getParameter('genero');
                $data['fecha_nacimiento'] = $lista['E']; // $request->getParameter('fecha_nacimiento');
                $data['empresa'] = $lista['F']; // $request->getParameter('empresa');
                $data['tipo_usuario'] = $lista['G']; //$request->getParameter('tipo_usuario');
                $data['primer_nombre'] = $lista['H']; // $request->getParameter('primer_nombre');
                $data['segundo_nombre'] = $lista['J']; // $request->getParameter('segundo_nombre');
                $data['primer_apellido'] = $lista['I']; // $request->getParameter('primer_apellido');
                $data['segundo_apellido'] = $lista['K']; // $request->getParameter('segundo_apellido');
                $data['puesto'] = $lista['L']; // $request->getParameter('puesto');
                $data['departamento'] = $lista['M']; //$request->getParameter('departamento');
                $data['jefe'] = $lista['N']; // $request->getParameter('jefe');
                $data['fecha_alta'] = $lista['O']; //$request->getParameter('fecha_alta');
                $data['sueldo'] = $lista['P']; //$request->getParameter('sueldo');
                $data['codigo'] = $lista['A']; //$request->getParameter('codigo');
                $handler = curl_init();
                curl_setopt($handler, CURLOPT_RETURNTRANSFER, TRUE);
                curl_setopt($handler, CURLOPT_URL, $url);
                curl_setopt($handler, CURLOPT_POST, true);
                curl_setopt($handler, CURLOPT_POSTFIELDS, $data);
                $resultado = curl_exec($handler);
                curl_close($handler);
                echo "<pre>";
                print_r($data);
                echo "</pre>";
                echo "<pre>";
                print_r($resultado);
                echo "</pre>";
                if ($conta == 50) {
                    die();
                }
            }
        }
    }
